import Earth from "./Earth";
import {useEffect, useRef} from "react";

function ObjectCreatorEarth({ objectIndex }) {
        const ObjectCreatorEarthRef = useRef(null);

        useEffect(() => {
                const ObjectCreatorEarthElement = ObjectCreatorEarthRef.current;
                if (ObjectCreatorEarthElement) {
                        const { width, height } = ObjectCreatorEarthElement.getBoundingClientRect();
                        console.log("Размер ObjectCreator:", width);
                }
        }, []);
        if (objectIndex >= 0 && objectIndex <= 99) {
                return <Earth ref={ObjectCreatorEarthRef}/>;
        } else {
                return null;
        }
}

export default ObjectCreatorEarth;
